package Map;import com.google.common.collect.Maps;import java.util.HashMap;import java.util.Iterator;import java.util.Map;/** * Created by Tan on 2016/11/25. */public class MapTest {    public static void main(String... args) {        HashMap<Integer, Integer> myMaps = Maps.newHashMap();        myMaps.put(1, 1);        myMaps.put(2, 2);        myMaps.put(3, 3);        for (Map.Entry<Integer, Integer> entry : myMaps.entrySet()) {            Integer key = entry.getKey();            Integer value = entry.getValue();            System.out.println("key:" + key + "value" + value);        }        Iterator iterator = myMaps.entrySet().iterator();        while (iterator.hasNext()){            Map.Entry<Integer,Integer> entry = (Map.Entry<Integer, Integer>) iterator.next();            Integer key = entry.getKey();            Integer value = entry.getValue();            System.out.println("key:" + key + "value" + value);        }    }}